import styled from '@emotion/styled';
import type from './type';
export var H1 = styled('h1')(type.h1);
export var H2 = styled('h2')(type.h2);
export var H3 = styled('h3')(type.h3);
export var H4 = styled('h4')(type.h4);
export var H5 = styled('h5')(type.h5);
